import CampaignFactory from './build/CampaignFactory.json';
const web3 = dynamic(
  () => import('./web3'),
  {
    ssr: false
  }
)

const instance = new web3.eth.Contract(
  JSON.parse(CampaignFactory.interface),
  '0x93BAd7357357D50ba4Df406fba7CD6C4293bEfd3'
);

export default instance;
